window.bookSummaryJSON = "<p><b>From the number one </b><b><i>New York Times</i></b><b> best-selling author comes a new explosive thriller featuring forensic sculptor Eve Duncan.</b></p> <p>Iris Johansen returns with a thrilling novel of action and danger where fan favorite Eve Duncan is thrown once more into a deadly game of intrigue. It begins when Eve receives a package containing a skull - and instructions for Eve to do her work reconstructing it.</p> <p>When she does, a beautiful woman's face emerges. But when Eve is introduced to the dead woman's mirror image, a game is on where her twin's life hangs in the balance.</p>"; 
